import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import History from './pages/History';
import Home from './pages/Home';

function App() {
  const baseURL = 'http://localhost:8080';
  const [weatherRecords, setWeatherRecords] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get(`${baseURL}/api/v1/weather`)
      .then((response) => {
        setWeatherRecords(response.data);
      })
      .catch(error => {
        setError(error);
      });
  }, []);

  if (error) return `Error: ${error.message}`;
  if (!weatherRecords || weatherRecords.length === 0) return "No weather records!";

  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Home weatherRecords={weatherRecords} />} />
        <Route path="historik" element={<History weatherRecords={weatherRecords} />} />
        <Route path="*" element={<h1>Not Found</h1>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
